import Webcam from 'react-webcam';
import React from 'react';
import  {useRef,useState}  from 'react';
function Ff(){
    const[img,setImg]=useState("");
    const winref=useRef(null);
    function capt(){
        const im=winref.current.getScreenshot();
        setImg(im);
    }
    return(
        <>
        <div className="d2">
            <Webcam audio={false}/>
        </div>
        </>
    )
}
export default Ff;
